import React, { useState, useEffect } from "react";
import PostDataService from "../../services/PostService";
import { Link } from "react-router-dom";
import '../../styles/PostList.css';
//import Like from './like';

const PostList = () => {
  const [posts, setPosts] = useState([]);
  const [searchTitle, setSearchTitle] = useState("");
  useEffect(() => {
    async function retrievePosts(){ 
      const response = await PostDataService.getAll();
      setPosts(response);
    }
    retrievePosts()
  }, []);
  function onChangeSearchTitle(e) {
    const searchTitle = e.target.value;
    setSearchTitle(searchTitle);
  };
  
  const findByTitle = () => {
    TutorialDataService.findByTitle(searchTitle)
      .then(response => {
        setTutorials(response.data);
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  };
  return (
    <div className="container_postList">
      <h1>Liste des Posts</h1>
      <div className="search_container">
        <input
          type="text"
          id="input_search"
          className="input_search_post"
          placeholder="Rechercher par titre"
          value={searchTitle}
          onChange={onChangeSearchTitle}
        />
        <button
          className="search_btn"
          type="button"
          onClick={findByTitle}>
          Rechercher
        </button>
      </div>
      {posts &&
        posts.map((post) => (
        <Link key={post.id} to={"/posts/" + post.id} className="post_list_item ">
          <h1 className="post_title">{post.title}</h1>
          <p>{post.description}</p>
          <div className="author_like">
            <p>{post.author}</p>
          </div>
        </Link>
      ))}        
    </div>
  );
};
export default PostList;
